/* W25Q32   = 32Mbit = 4MB: 0x000000h-0x3fffffh 共64个block 每个占64K
 * a block  = 64KB
 * a sector = 4KB
 * a page   = 256Bytes
 * a block  = 16 sector = 16 page
 *   block_0 -- block_63:   64blocks
 *   block_0 : 0x000000  -  0x00ffff
 *   block_1 : 0x010000  -  0x01ffff
 *   block_2 : 0x020000  -  0x02ffff
 *   block_3 : 0x030000  -  0x03ffff 
 *   block_4 : 0x040000  -  0x04ffff
 *   block_5 : 0x050000  -  0x05ffff 
 *   block_6 : 0x060000  -  0x06ffff 
 *   block_7 : 0x070000  -  0x07ffff
 *   block_8 : 0x080000  -  0x08ffff 
 *   block_9 : 0x090000  -  0x06ffff 
 *   block_10: 0x0A0000  -  0x07ffff
 *   block_11: 0x0B0000  -  0x08ffff     
 *                .
 *   block_63: 0x400000  -  0x3f0000
 */
 
#define FLASH_ID                0XEF15//W25Q32 ID
#define W25Q_WriteEnable		0x06 
#define W25Q_WriteDisable		0x04 
#define W25Q_ReadStatusReg		0x05 
#define W25Q_WriteStatusReg		0x01 
#define W25Q_ReadData			0x03 
#define W25Q_FastReadData		0x0B 
#define W25Q_FastReadDual		0x3B 
#define W25Q_PageProgram		0x02 
#define W25Q_BlockErase64K  	0xD8 
#define W25Q_BlockErase32K  	0x52 
#define W25Q_SectorErase		0x20 
#define W25Q_ChipErase			0xC7 
#define W25Q_PowerDown			0xB9 
#define W25Q_ReleasePowerDown	0xAB 
#define W25Q_DeviceID			0xAB 
#define W25Q_ManufactDeviceID	0x90 
#define W25Q_JedecDeviceID		0x9F 

#define FLASH_DESELECT()        GPIO_SetBits(FLASH_GPIO,   FLASH_GPIO_PIN_CS)
#define FLASH_SELECT()          GPIO_ResetBits(FLASH_GPIO, FLASH_GPIO_PIN_CS)



/****************************************************************
  * @brief  initialize the flash's cs pin
****************************************************************/
void spiFlashInit(void)
{
  //! Configure I/O for Flash Chip select 
  GPIO_InitTypeDef GPIO_InitStructure;
  GPIO_InitStructure.GPIO_Pin   = FLASH_GPIO_PIN_CS;
  GPIO_InitStructure.GPIO_Mode  = GPIO_Mode_OUT;
  GPIO_InitStructure.GPIO_OType = GPIO_OType_PP;
  GPIO_InitStructure.GPIO_PuPd  = GPIO_PuPd_NOPULL;
  GPIO_Init(FLASH_GPIO, &GPIO_InitStructure);
  
  FLASH_DESELECT();
}




/****************************************************************
  * @brief  Read the status registers of W25Q32
  * BITS    9    8    7    6    5    4    3    2    1    0  
  *         QE SPR1 SPR0  SEC   TB  BP2  BP1  BP0  WEL  BUSY
  * @SPR:  默认0， 状态寄存器保护位，配合WP使用
  * @TB,BP2,BP1,BP0:FLASH区域写保护设置
  * @WEL：写使能锁定
  * @BUSY:忙标记位(1: 忙; 0:空闲)
****************************************************************/
uint8_t spiFlashReadStatusReg(void)   
{  
	uint8_t byte = 0;   
	FLASH_SELECT();                           
	spiReadWriteByte(W25Q_ReadStatusReg);      
	byte = spiReadWriteByte(0Xff);              
	FLASH_DESELECT();                               
	return byte;   
} 




/****************************************************************
  * @brief  write the status registers of W25Q32
  * @ only SPR TB BP2 BP1 BP0 can be writen into
****************************************************************/
void spiFlashWriteStatusReg(uint8_t data)
{
	FLASH_SELECT();                            
	spiReadWriteByte(W25Q_ReadStatusReg);     
	spiReadWriteByte(data);               
	FLASH_DESELECT();
}



/****************************************************************
  * @brief  wait for not busy
****************************************************************/
static void spiFlashWaitBusy(void)   
{   
	while((spiFlashReadStatusReg()&0x01)==0x01);
}



/****************************************************************
  * @brief  spi write enable
  * @ set WEL 
****************************************************************/
static void spiFlashWriteEnable(void)   
{
	FLASH_SELECT();                            
    spiReadWriteByte(W25Q_WriteEnable);     
	FLASH_DESELECT();                          	      
} 



/****************************************************************
  * @brief  spi write disable
  * @ clr WEL 
****************************************************************/
static void spiFlashWriteDisable(void)   
{
	FLASH_SELECT();                            
    spiReadWriteByte(W25Q_WriteDisable);     
	FLASH_DESELECT();                          	      
}


/****************************************************************
  * @brief  read ID
  * @ the right ID is 0XEF15
****************************************************************/
uint16_t spiFlashReadID(void)
{
	uint16_t Temp = 0;	  
	FLASH_SELECT();				    
	spiReadWriteByte(0x90); 
	spiReadWriteByte(0x00); 	    
	spiReadWriteByte(0x00); 	    
	spiReadWriteByte(0x00); 	 			   
	Temp |= spiReadWriteByte(0xFF)<<8;  
	Temp |= spiReadWriteByte(0xFF);	 
	FLASH_DESELECT();				    
	return Temp;
}



/****************************************************************
  * @brief  read n bytes flash data from readaddr to pbuffer
  * @param  buffer  : address for hold data
  * @param  readaddr: address for read data
  * @param  nbytes  : n bytes to read (max is 65535)
****************************************************************/
void spiFlashRead(uint8_t * buffer, uint32_t readaddr, uint16_t nbytes)   
{ 
 	uint16_t i;    												    
	FLASH_SELECT();                              
    spiReadWriteByte(W25Q_ReadData);            
    spiReadWriteByte((uint8_t)((readaddr)>>16));   
    spiReadWriteByte((uint8_t)((readaddr)>>8));   
    spiReadWriteByte((uint8_t)readaddr);   
    for(i=0; i<nbytes; i++)
	{ 
        buffer[i]=spiReadWriteByte(0XFF);   
    }
	FLASH_DESELECT();                            	      
}




/****************************************************************
  * @brief  write n bytes to flash (n must be less than 256)
  * @param  buffer   : address of data where it comes from
  * @param  writeaddr: address of date need to be writen to 
  * @param  nbytes   : n bytes to be writen(less than 256, for a page's size is 256Bytes)
****************************************************************/
void spiFlashWritePage(uint8_t * buffer, uint32_t writeaddr, uint16_t nbytes)
{
 	uint16_t i;  
    spiFlashWriteEnable();             
	FLASH_SELECT();                          
    spiReadWriteByte(W25Q_PageProgram);        
    spiReadWriteByte((u8)((writeaddr)>>16)); 
    spiReadWriteByte((u8)((writeaddr)>>8));   
    spiReadWriteByte((u8)writeaddr);   
    for(i=0; i<nbytes; i++)spiReadWriteByte(buffer[i]);
	FLASH_DESELECT();                            
	spiFlashWaitBusy();					   
} 



/****************************************************************
  * @brief  erase the whole chip
  * @note   W25Q32: 40s
****************************************************************/
void spiFlashEraseChip(void)   
{                                             
    spiFlashWriteEnable();                 
    spiFlashWaitBusy();   
  	FLASH_SELECT();                             
    spiReadWriteByte(W25Q_ChipErase);        
	FLASH_DESELECT();                              	      
	spiFlashWaitBusy();   				   
} 



/****************************************************************
  * @brief  erase a sector
  * @addr_sect: 0 ~ 1023  
  * @note   each sector is 4K bytes
****************************************************************/
void spiFlashEraseSector(uint32_t addr_sect)   
{                                             
	addr_sect *= 4096;
    spiFlashWriteEnable();
    spiFlashWaitBusy();   
  	FLASH_SELECT();                          
    spiReadWriteByte(W25Q_SectorErase);       
    spiReadWriteByte((uint8_t)((addr_sect)>>16));  
    spiReadWriteByte((uint8_t)((addr_sect)>>8));   
    spiReadWriteByte((uint8_t)addr_sect);  
	FLASH_DESELECT();                            	      
    spiFlashWaitBusy();   				  
} 


/****************************************************************
  * @brief  erase a 32K block
  * @addr_sect: 0 ~ 127 total 128 
  * @note  each block is 32K bytes
****************************************************************/
void spiFlashEraseBlock32(uint32_t addr_block_32)   
{                                             
	addr_block_32 *= 32768;
    spiFlashWriteEnable();
    spiFlashWaitBusy();   
  	FLASH_SELECT();                          
    spiReadWriteByte(W25Q_BlockErase32K);       
    spiReadWriteByte((uint8_t)((addr_block_32)>>16));  
    spiReadWriteByte((uint8_t)((addr_block_32)>>8));   
    spiReadWriteByte((uint8_t)addr_block_32);  
	FLASH_DESELECT();                            	      
    spiFlashWaitBusy();   				  
} 


/****************************************************************
  * @brief  erase a 64K block
  * @addr_sect: 0 ~ 63 total 64 64Ks
****************************************************************/
void spiFlashEraseBlock64(uint32_t addr_block_64)   
{                                             
	addr_block_64 *= 65536;
    spiFlashWriteEnable();
    spiFlashWaitBusy();   
  	FLASH_SELECT();                          
    spiReadWriteByte(W25Q_BlockErase64K);       
    spiReadWriteByte((uint8_t)((addr_block_64)>>16));  
    spiReadWriteByte((uint8_t)((addr_block_64)>>8));   
    spiReadWriteByte((uint8_t)addr_block_64);  
	FLASH_DESELECT();                            	      
    spiFlashWaitBusy();   				  
} 



void readOutFlash(void)
{
	uint8_t buffer[1024]={0};
	uint16_t i=0;
	for(i=0; i<4096; i++)
	{
		spiFlashRead(buffer, 1024*i, 1024);
		usart1UsbSendBuffer(buffer, 1024);
	}
	powerOff();
}



